const initialState = {
  vaccinations: [],
};

const petVaccinationReducer = (state = initialState, action) => {
  switch (action.type) {
    case "ADD_VACCINATION_LIST":
      return {
        ...state,
        vaccinations: action.payload,
      };
    case "ADD_VACCINATION":
      return {
        ...state,
        vaccinations: [...state.vaccinations, action.payload],
      };
    default:
      return state;
  }
};
export default petVaccinationReducer;
